using System;
using System.Collections.Generic;
using System.IO;
using System.Net;
using System.Text;
using System.Threading;
using TheBitBrine;

namespace PowerCoreServer
{
    class Program
    {
        static void Main(string[] args)
        {
            while (true)
            {
                try
                {
                    new Program().Run();
                    while (API.ServerThread.IsAlive)
                        Thread.Sleep(500);
                }
                catch { }
            }
        }

        private static QuickMan API;
        private static string LoaderPage;
        public void Run()
        {
            LoaderPage = Encoding.UTF8.GetString(Convert.FromBase64String(Loader.Data));
            API = new QuickMan();
            var Endpoints = new Dictionary<string, Action<HttpListenerContext>>();

            Endpoints.Add("stats", Stats);
            Endpoints.Add("watch", Watch);
            Endpoints.Add("get", Get);

            API.Start(8000, Endpoints, 20);
        }


        public bool FrameLock = false;
        public static string CurrentFrame = "";
        public void Stats(HttpListenerContext Context)
        {
            try
            {
                while (FrameLock)
                    Thread.Sleep(11);
                FrameLock = true;
                var Frame = new StreamReader(Context.Request.InputStream).ReadToEnd();
                if (Frame != null && !string.IsNullOrWhiteSpace(Frame))
                    CurrentFrame = Frame;
            }
            catch { }
            FrameLock = false;
            API.Respond("OK", Context);
        }


        public void Get(HttpListenerContext Context)
        {
            {
                try
                {
                    while (FrameLock)
                        Thread.Sleep(11);
                    FrameLock = true;
                    var bytes = Convert.FromBase64String(CurrentFrame);
                    API.Respond(new MemoryStream(bytes), "image/jpeg", Context);
                }
                catch { }
                FrameLock = false;
            }
        }

        public void Watch(HttpListenerContext Context)
        {
            Console.WriteLine($"[{DateTime.Now.ToString()}] {Context.Request.RemoteEndPoint} connected");
            API.Respond(LoaderPage, "text/html", Context);
        }

    }
}
